import React from 'react'

export const NotesList = (props) => {
    const { notes = [] , onSelect} = props

    notes.push({
        id: '1',
        title: 'test',
        text: 'text'
    })
    console.log('notes:' + notes.toString())

    return <div className="list-group">
        <>
            {notes.map(note => (
            <div data-testid={note.id} className="list-group-item" onClick={onSelect(note)}>{note.title}</div>
            ))}
        </>
    </div>
}
